@import "./../../constants/constants.scss";

.footer__container {
  background-color: $darker-gray;
  font-family: $font-family;
  color: $input-main-color;
  font-size: 16px;
  display: flex;
  justify-content: center;
  box-shadow: 0px 0px 32px 16px rgba(34, 40, 49, 0.75);
  box-sizing: border-box;
}

.footer__content {
  display: flex;
  justify-content: center;
  gap: 75px;
  padding: 80px 0;
  max-width: 1530px;
  margin: 20px;

  &--info {
    max-width: 230px;
  }

  &--contact {
    text-align: center;

    p {
      max-width: 160px;
      overflow-wrap: normal;
    }
  }

  &--social-media {
    text-align: center;

    .links {
      margin: 20px 0;

      a {
        text-decoration: none;
        color: $input-main-color;

        i {
          font-size: 40px;
        }
      }
    }
  }

  &--links {
    text-align: center;

    .links {
      margin-top: 45px;

      a {
        text-decoration: none;
        color: $input-main-color;
      }
    }
  }

  &--map {
    text-align: center;

    &__content {
      max-width: 500px;
      width: 500px;
      height: 180px;

      iframe {
        border: 0;
        border-radius: 15px;
        width: 100%;
        height: 100%;
      }
    }
  }
}

.footer_header {
  color: $input-background-color;
  font-weight: $font-weight-bold;
  margin-bottom: 20px;
}

